import axios from 'axios'

class AxiosRoutes {
    constructor() {
        this.baseUrl = 'http://localhost:5000'
    }

    async postUsers(params, userInfo) {
        const { data } = await axios.post(`${this.baseUrl}${params}`, userInfo)

        console.log(data)
    }
}

export default new AxiosRoutes()
